import { StyleSheet } from 'react-native';
import { THEME } from '../../theme';

export const styles = StyleSheet.create({
    container: {
        height: 60,
        width: 330,
        backgroundColor: THEME.COLORS.PRIMARY,
        borderRadius: 6,
        fontFamily: THEME.FONT_FAMILY.INTER.BOLD,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        flexDirection: 'row'
    }
});
